d27c85d8-1ac7-434e-adb9-0ac4557e107e=Readme\r\n\=\=\=\=\=\=\=\=\=\=\=\=\=\=\r\n\r\nConfiguration\r\n-------------------------------------\r\nDo not modify this module, instead\r\n1. Create a new custom module (e.g. DeepLinkCustomizations)\r\n\r\n2. Copy Pages/Microflows which you would like to modify to this new custom module and edit the copied Pages/Microflows in the new custom module.\r\n\r\n3. Create a general after startup microflow in your project settings if you didn't already. Call microflow 'StartDeeplink' from your general after startup microflow.\r\n\r\n4. DeeplinkHome microflow should be executed before a user of your application is presented a page. \r\nYou can do this by calling a custom microflow as Default home page. View 'Home_Desktop_Default' microflow to see an example which you could copy.    \r\n\r\n5. You can either add deeplinks by using the 'deeplink configuration overview' page. Attach 'ShowDeeplinkConfigurationOverview' to your navigation or\r\n copy the snippet 'DeeplinkConfigurationOverview' to a custom page for this.\r\n It is also possible to create deeplink configuration entries by executing 'CreateDeeplinkConfig' microflow. For example creating deeplinks after startup if they do not yet exist.\r\n 
